script: |
  super -f text -I q11375.spq | sort > q11375.out

inputs:
  - name: q11375.spq
    data: |
      SELECT + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 + col2 * + - col0 + col0 / col1 - ( + - col0 ) + - + 95 BETWEEN col1 AND - col0 + 31;
  - name: tab1

outputs:
  - name: q11375.out
    data: |
      51
      85
      91
